(88, '', 'NA-88', 'CLOSED', '10/23/2019', '729', '10/23/2019', '', '', 'MANULIFE', 'TECHNOLOGY', 'SUPPORT AND INFRASTRUCTURE', 'HELPDESK/SERVICE DESK (ZENDESK,SOLARWIND,SERVICENOW)', 'Director, End User Support & Technologies', 'CL6', 'N/A', '1', '1', '\"Advanced degree in Statistics, Math, Computer Science, Engineering or other related discipline (post-grad preferred),\n  Minimum of 10+ years of experience, with direct experience in the development and delivery of advanced analytics solutions to business', '', 'Quezon City', '', 'Pending', '', 'Some inputs/feedback from my candidate who\'s done with the HM Interview and Code Pairing from Manulife. Interview will consist of 2 Parts (1 hour each for HM Interview and Code Pairing). Hope this helps. \n  HM Interview\n  - Panel Interview\n  - Interviewers will focus on candidate’s professional experience and projects\n  - Challenges and difficult tasks that the candidate encountered from work\n  Code Pairing\n  - They will forward a Hacker Rank Link to the candidate on the spot (let’s advise them to use a desktop/laptop during interview), the interviewer has an access with the link, he can also add some inputs/codes/strings while the candidate is using it. It’s like a collaboration with the interviewer. \n  - Code Pairing will consist 2 parts: 1 problem to solve and Refactoring of Codes\n  - First Part of Code Pairing: Candidate will solve the given problem while discussing to the interviewer why he/she came up with those code/strings. Once it’s working, they will ask the candidate to optimize his first draft, or will ask if there’s any other way to optimize the code. If the candidate said that there is, he will create new strings/code and explain it to the interviewer.\n  - Second Part of Code Pairing: Refactoring of Codes. They will provide a code that is already working, they just need to refactor and improve it.', '', '', '', '2021-11-18 08:32:15', '2021-11-18 08:32:15'),
