(453, '', 'NA-453', 'CLOSED', '1/29/2020', '631', '1/29/2020', '6/21/2020', '', 'MANULIFE', 'TECHNOLOGY', 'DATA MANAGEMENT', 'ANALYTICS/DATA SCIENCE/ANALYST', 'Associate Business Analytics Specialist', 'CL10', 'N/A', '1', '1', 'Duties include: \n  • Deploy tag management softwares and configure digital analytics & digital marketing softwares across websites, mobile apps, point-of-sales devices \n  • Perform routine QA on analytics software to ensure data accuracy on SIT, UAT, & PR', '', 'Quezon City', 'Rotating: Morning and Mid Shift', 'Max 40K basic', '', 'Some inputs/feedback from my candidate who\'s done with the HM Interview and Code Pairing from Manulife. Interview will consist of 2 Parts (1 hour each for HM Interview and Code Pairing). Hope this helps. \n  HM Interview\n  - Panel Interview\n  - Interviewers will focus on candidate’s professional experience and projects\n  - Challenges and difficult tasks that the candidate encountered from work\n  Code Pairing\n  - They will forward a Hacker Rank Link to the candidate on the spot (let’s advise them to use a desktop/laptop during interview), the interviewer has an access with the link, he can also add some inputs/codes/strings while the candidate is using it. It’s like a collaboration with the interviewer. \n  - Code Pairing will consist 2 parts: 1 problem to solve and Refactoring of Codes\n  - First Part of Code Pairing: Candidate will solve the given problem while discussing to the interviewer why he/she came up with those code/strings. Once it’s working, they will ask the candidate to optimize his first draft, or will ask if there’s any other way to optimize the code. If the candidate said that there is, he will create new strings/code and explain it to the interviewer.\n  - Second Part of Code Pairing: Refactoring of Codes. They will provide a code that is already working, they just need to refactor and improve it.', '', '', '', '2021-11-18 08:32:16', '2021-11-18 08:32:16'),
(454, '', 'NA-454', 'CLOSED', '1/29/2020', '631', '1/29/2020', '6/21/2020', '', 'MANULIFE', 'TECHNOLOGY', 'DATA MANAGEMENT', 'ANALYTICS/DATA SCIENCE/ANALYST', 'Data Scientist-Tech', 'CL10', 'N/A', '1', '1', 'Individual Accountabilities:\n  • Develops and implements analytics enabled solutions to improve business process, to generate insights, support business goals and strategy development\n  • Owns and delivers complete projects of moderate scope and manages a', '', 'Quezon City', 'Rotating: Morning and Mid Shift', 'Max 70K basic', '', 'Some inputs/feedback from my candidate who\'s done with the HM Interview and Code Pairing from Manulife. Interview will consist of 2 Parts (1 hour each for HM Interview and Code Pairing). Hope this helps. \n  HM Interview\n  - Panel Interview\n  - Interviewers will focus on candidate’s professional experience and projects\n  - Challenges and difficult tasks that the candidate encountered from work\n  Code Pairing\n  - They will forward a Hacker Rank Link to the candidate on the spot (let’s advise them to use a desktop/laptop during interview), the interviewer has an access with the link, he can also add some inputs/codes/strings while the candidate is using it. It’s like a collaboration with the interviewer. \n  - Code Pairing will consist 2 parts: 1 problem to solve and Refactoring of Codes\n  - First Part of Code Pairing: Candidate will solve the given problem while discussing to the interviewer why he/she came up with those code/strings. Once it’s working, they will ask the candidate to optimize his first draft, or will ask if there’s any other way to optimize the code. If the candidate said that there is, he will create new strings/code and explain it to the interviewer.\n  - Second Part of Code Pairing: Refactoring of Codes. They will provide a code that is already working, they just need to refactor and improve it.', '', '', '', '2021-11-18 08:32:16', '2021-11-18 08:32:16'),
