(2057, '1ST PRIO', 'NA-2057', 'OPEN', '3/2/2021', '233', '3/9/2021', '3/1/2021', '', 'MANULIFE', 'TECHNOLOGY', 'SOFTWARE DEVELOPMENT LIFE CYCLE', 'DEVELOPER (JAVA, .NET, PHP, JAVASCRIPT,PYTHON ETC.)', 'Senior Full-stack Software Engineer', 'CL9', '', '1', '1', 'Job Description\n  \n  Location: Quezon City\n  \n  Shift: Morning shift\n  \n  Do you want to be part of the team that redefines how we get work done? We are changing the way we develop and we want you to be part of it! We are growing our Engineering Transform', '', 'Quezon City', 'morning', '70-110k', 'Validation-upload on workday-coding exam-tech interview-coding exam-FI', 'Some inputs/feedback from my candidate who\'s done with the HM Interview and Code Pairing from Manulife. Interview will consist of 2 Parts (1 hour each for HM Interview and Code Pairing). Hope this helps. \n  HM Interview\n  - Panel Interview\n  - Interviewers will focus on candidate’s professional experience and projects\n  - Challenges and difficult tasks that the candidate encountered from work\n  Code Pairing\n  - They will forward a Hacker Rank Link to the candidate on the spot (let’s advise them to use a desktop/laptop during interview), the interviewer has an access with the link, he can also add some inputs/codes/strings while the candidate is using it. It’s like a collaboration with the interviewer. \n  - Code Pairing will consist 2 parts: 1 problem to solve and Refactoring of Codes\n  - First Part of Code Pairing: Candidate will solve the given problem while discussing to the interviewer why he/she came up with those code/strings. Once it’s working, they will ask the candidate to optimize his first draft, or will ask if there’s any other way to optimize the code. If the candidate said that there is, he will create new strings/code and explain it to the interviewer.\n  - Second Part of Code Pairing: Refactoring of Codes. They will provide a code that is already working, they just need to refactor and improve it.', '3/29/2021', '', '', '2021-11-18 08:32:18', '2021-11-18 08:32:18');
