(3320, '', 'AG-461', 'CLOSED', '11/9/2020', '346', '', '', '', 'OPTUM/UHG', 'OPERATIONS', 'GENERAL OPERATIONS', 'Customer Service-Contractual', 'CSR FTC Hiring - Alabang', 'CL13', '', '10', 'TBA', 'Qualifications\n  \n  · High school graduate with at least 2 years BPO voice experience\n  \n  · 1st year college with at least 1 year BPO voice experience\n  \n  · Completed 2 years in college with at least 6 months BPO voice experience\n  \n  · College graduate', 'Highschool Graduate', 'Alabang', 'Night Shift', 'Fresher/Shifter – 14,500 + 3,600\n  \n  6 moths – 12 months – 18,000 + 3,600\n  \n  13 months and above – 20,000 + 3,600', 'Hiring Process (One-day)\n  \n  1. Validation - candidates for validation will be submitted by VCClink team and result will be sent by Optum team\n  \n  2. HRI to be conducted by Vcclink Team\n  \n  3. CAT to be endorsed by Vcclink to Jen; CAT passing score – 2.4\n  \n  4. Domain Interview via OTP (6pm to 10pm)\n  \n  5. Job offer to be done by Vcclink Team and discussion of needed requirements', 'Work Set-up\n  \n  · Onsite\n  \n  · Free shuttle (certain pick-up/drop-off location) to be discussed by Optum team\n  \n  · Shift – Night shift with 2 days off but not fixed weekends off', '11/20/2020', '', '', '2021-11-18 08:32:19', '2021-11-18 08:32:19'),
(3321, '', 'AG-462', 'CLOSED', '11/16/2020', '339', '', '', '', 'TRANSCOSMOS', 'TECHNOLOGY', 'SUPPORT AND INFRASTRUCTURE', 'Technical Support-General', 'Technical Support Representative', 'CL13', '', '10', '', 'AT LEAST 2ND. YR COLLEGE OF ANY COURSE ATLEAST 1 YR. BPO EXP. IN TECH ACCOUT; PREFERRABLY MOBILE ACCT - standard pronunciation, fluent speaking, mellow tone, and good expression and communication skills;\n  - good writing and communication skills;\n  \n  TAG', 'College Graduate', 'Pasig', 'Shifting', '20K-22K', '1. Mainly handles and answers user questions and inquiries.\n  2. Escalates technical problems/complaints that cannot be resolved within SLA to relevant teams.\n  3. Performs systematic tracking of escalated problems until they are closed.', 'Transcosmos - Technical Support Representative-Technical Device Account (MOBILE PHONE, TABLETS, NETWORK DEVICES, ANDROID OS)', '12/1/2020', '', '', '2021-11-18 08:32:19', '2021-11-18 08:32:19'),
(3322, '', 'AG-463', 'CLOSED', '11/17/2020', '338', '', '', '', 'STARTEK', 'OPERATIONS', 'GENERAL OPERATIONS', 'Customer Service-General', 'Customer Service Representative', 'CL15', '', 'TBA', '', 'Minimum Qualifications:\n  \n  i5, 4gb RAM desktop or laptop with Windows 10 installed\n  At least 15 mbps internet connection\n  Must have completed at least High School/ Senior High School.\n  Must be able to communicate efficiently in English.\n  Must be at ', 'Highschool Graduate', 'Makati', 'Shifting', 'TBA', '', 'Work at Home', 'TBA', '', '', '2021-11-18 08:32:19', '2021-11-18 08:32:19'),
(3323, '', 'AG-464', 'CLOSED', '11/17/2020', '338', '', '', '', 'LEGATO', 'OPERATIONS', 'GENERAL OPERATIONS', 'Customer Service-Health', 'Customer Service Representative-Healthcare', 'CL13', '', '24', '', 'Minimum Qualifications:\n  \n  - 4-year course College Graduate with no contact center / BPO experience OR completed 2 years of College with at least 6 months of voice support contact center / BPO experience\n  \n  - willing to work onsite at Mandurriao, Iloi', 'College Graduate', 'Iloilo', 'Shifting', 'TBA', 'VCC uploads candidate details via TP links per site/profile. We presume that your team conducts some sort of paper screening on candidates to verify qualifications and not just upload leads to “reserve” candidates in the system without checking if they qualify or not.\n  \n  \n  \n  ILO\n  \n  CSR (Voice) - https://talkpu.sh/5hOUtC\n  \n  \n  \n  a.2 VCC sends candidate information for name validation. Ensure your subject has site and date of endorsement for easier follow through. Ideal table format below for easier tracking. This allows us to verify if you can go ahead with Initial and Behavioral Interviews with candidates. This step should resolve candidate ownership conflicts. Legato TA will aim to answer validation conflicts within 2 days from endorsement date – more time may be needed if there are application history details needed such as domain interview results and viability of candidates for reprocessing for the same LOBs, etc.\n  \n  \n  \n  - for ILO, pls send to DL-SourcingPHL@legatohealth.com, Jeth Palomo cc Jorj Mojares, MJ Erispe, Mark Anthony Espino\n  \n  - for MNL, pls send to DL-SourcingPHL@legatohealth.com cc Maila Ceniza VCC conducts Initial and Behavioral Interviews with candidates signed off by Legato TA from validation results.\n  \n  \n  \n  c. VCC forwards the completed Initial & Behavioral Interview sheet along with CV of candidate to the below. VCC should have set some expectations for scheduling of Legato team on domain interviews or online assessment (depending on the role).\n  \n  \n  \n  - for ILO (CSR Voice), pls send to Jeth Palomo, DL-SourcingPHL@legatohealth.com cc Jorj Mojares\n  \n  - for MNL, pls send to DL-SourcingPHL@legatohealth.com, GlaizaMari.Wenceslao@anthem.com cc Maila Ceniza\n  \n  \n  \n  d. Legato TA will schedule candidate to either domain interviews or online assessment. Feedback on application status will be given by either recruiter in charge directly or through a POC from Sourcing in contact with the recruiter.\n  \n  \n  \n  e. VCC should have their own tracking of endorsements and application status for accountability of both parties.\n  \n  We are setting a 3-week period where we own candidates from the time of their application to be able to reach them and follow through with processing of their application. Several attempts via phone, sms, fb messenger, or other applicable communication channels are done during this period. Considering as well that main conflicts revolve around Legato employees submitting their referrals via applicant tracking system and we set time to contact referrers and provide feedback or have them reach out to their referrals to reconnect with us.\n  Patrick from ILO or Eli from MNL can already reply back for confirmation on name validation – for those with no conflicts. For those tagged by VCC as for revalidation (and for either site), Sourcing (Charm, Eli, Gela, or Chan) will reply back for confirmation. We will analyze application history of the candidate to determine if they can be retagged and processed by VCC for II/BI.\n  We need to confirm the ff from your team:\n  If you can conduct the proctored online assessment on our behalf. As discussed, the exam is done via SHL portal and is completely online but both candidate and proctor will be in a webex call for live monitoring.\n  If you can collect the pre-employment requirements mentioned in item 1 from candidates on our behalf as this is a more efficient way of follow through vs another handoff with our team.\n  As discussed, I’ll let Marky Espino from our ILO team take over on calibration sessions to get your recruiters up to speed on the interview process.', 'Work from Home Capability Requirements:\n  \n  - existing wired / DSL internet connection\n  \n  - internet connection speed of at least 20 Mbps; candidates are required to submit screenshots of a speed test\n  \n  - a laptop or desktop to use for the online assessment (but only for the recruitment process); if hired, we will deliver equipment setup for candidates – this happens during the pre-boarding period before they start day 1 of new associate orientation\n  \n  \n  \n  c. Pre-Employment Requirements:\n  \n  - as mentioned, even if candidates pass all the recruitment steps, if they don’t have or complete their pre-boarding items, we won’t be able to give them a job offer\n  \n  - non-negotiable items candidates need to submit during the pre-boarding stage for us to extend Job Offers – candidates must have valid ID or proof of identification of the ff\n  \n  SSS\n  TIN\n  Pag-ibig / HDMF\n  Philhealth\n  NBI Clearance\n  \n  \n  d. Processing Timeline\n  \n  - all candidates must be identified for hire / accepted Job Offers at least 2 weeks before official start date as the pre-employment requirements', '12/21/2020', '', '', '2021-11-18 08:32:19', '2021-11-18 08:32:19'),
